import React from "react";
import "./App.css";

const App = () => {
  const vegetables = ["감자", "고구마", "오이", "가지", "옥수수", "토마토"];
  return (
    <div className="app-style">
      {vegetables.map((vegetableName) => {
        return (
          <div className="box-style" key={vegetableName}>
            {vegetableName}
          </div>
        );
      })}
    </div>
  );
};

export default App;
